import Cookies from 'universal-cookie/lib'
import styles from '../styles/auththentication/Auth.module.css'
import {createMuiTheme, ThemeProvider} from "@material-ui/core";
import React, {useEffect, useState} from "react";
import {useRouter} from "next/router";
import AuthenticationLayout from "../components/layout/AuthenticateLayout";
import Head from "next/head";
import {getLanguage, setCookiesLanguage} from "../utils/shared/Language";
import {setThemeCookie} from "../utils/shared/Theme";
import signIn from "../utils/authentication/SignIn";
import signOut from "../utils/authentication/SignOut";
import ClearStorage from "../utils/authentication/ClearStorage";

const cookies = new Cookies()
export default function Signin() {

    const [dark, setDark] = useState(false)
    const router = useRouter()
    const [lang, setLang] = useState(null)
    const [visible, setVisible] = useState(false)
    const [password, setPassword] = useState('')
    const [email, setEmail] = useState('')

    useEffect(() => {
        if((new Cookies()).get('jwt') !== undefined)
            signOut().then(res => {
                if (res)
                    ClearStorage()
                else
                    router.push('/', '/', {locale: router.locale})
            })
        setLang(getLanguage(router.locale, router.pathname))

        setDark(cookies.get('theme') === '0')

        if (router.isReady && (new Cookies()).get('lang') !== undefined && (new Cookies()).get('lang') !== router.locale) {
            router.push('/signin', '/signin', {locale: (new Cookies()).get('lang')}).catch(r => console.log(r))
            setLang(getLanguage(router.locale, router.pathname))
        } else
            setLang(getLanguage(router.locale, router.pathname))


    }, [router.locale, router.isReady])

    async function authenticate(){
        await signIn({
            email: email,
            password: password,
            locale: router.locale
        }).then(() => router.push('/', '/', {locale: router.locale}))
    }

    function changeLang(event){
        setCookiesLanguage(event.target.value)
        const newLang = getLanguage(event.target.value, '/signin')
        setLang(newLang)
        router.push('/signin', '/signin', {locale: event.target.value})
    }

    function changeTheme(){
        setDark(!dark)
        setThemeCookie()
    }
    if (lang !== null)
        return (
            <div className={styles.auth_container} style={{
                backgroundColor: '#39adf6',
                color: dark ? 'white' : '#111111'
            }}>
                <ThemeProvider theme={createMuiTheme({
                    palette: {
                        type: dark ? 'dark' : "light"
                    }
                })}>
                    <Head>
                        <title>{lang.signin}</title>
                    </Head>
                    <div className={styles.art_half_container}>
                        <div>
                            <img style={{width: '15vw'}}
                                 src={'data:image/png;base64,'}
                                 alt={"aeb"}/>
                        </div>
                        <div style={{position: 'fixed', bottom: -5, left: 0, zIndex: 0}}>
                            <img style={{width: '31vw'}}
                                 src={'data:image/png;base64,'}
                                 alt={'rocket'}/>
                        </div>
                    </div>
                    <div className={styles.input_half_container}
                         style={{
                             backgroundColor: !dark ? 'white' : '#303741',
                             boxShadow: 'rgba(0, 0, 0, 0.05) 0 1px 2px 0'
                         }}>
                        <AuthenticationLayout
                            dark={dark}
                            setEmail={setEmail}
                            email={email}
                            password={password}
                            setPassword={setPassword}
                            lang={lang}
                            locale={router.locale}
                            setVisible={setVisible}
                            visible={visible}
                            setDark={setDark}
                            authenticate={authenticate}
                            setLang={setLang}
                            changeLang={changeLang}
                            changeTheme={changeTheme}
                        />
                    </div>
                </ThemeProvider>
            </div>
        )
    else
        return <>cafe</>
}
